import React, { Component } from "react";
import { Link } from "react-router-dom";
import styled from "styled-components";
import { ButtonContainer } from "./Button";

class Navbar extends Component {
  render() {
    return (
     <NavWrapper className="navbar navbar-light"> 
     <a className="navbar-brand">Navbar</a>
     <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent1"  aria-controls="navbarSupportedContent1" aria-expanded="false" aria-label="Toggle navigation"><span class="dark-blue-text"><i
        class="fas fa-bars fa-1x"></i></span>></button>
        <ul className="navbar-nav align-items-center">
        <li className="nav-item">
            <Link to="/" className="nav-link">
              Home
            </Link>
          </li>
          <li className="nav-item ml-3">
            <Link to="/products" className="nav-link">
              products
            </Link>
          </li>
        </ul>
        <Link to="/ShoppingCart" className="ml-auto">
          <ButtonContainer>
            <span className="mr-2">
              <i className="fas fa-cart-plus" />
            </span>
            my cart
          </ButtonContainer>
        </Link>
      </NavWrapper>
    );
  }
}
export default Navbar;

const NavWrapper = styled.nav`
  background: var(--darkRed);
  box-shadow: 0 2px 2px -2px rgba(0, 0, 0, 1);
  .nav-link {
    color: var(--white) !important;
    font-size: 1.3rem; // 1 rem = 16 px
    text-transform: capitalize;
    &:hover {
      color: var(--white) !important;

      border-bottom: 2px solid var(--white);
      padding-bottom: 4px;
    }
  }

  //  <NavWrapper className="navbar navbar-expand-sm navbar-dark px-sm-4">
`;
